import React from 'react';
import { Redirect } from 'react-router-dom';
import './homePage.css';

authenticateUser = e => {
	if ("john@smu.edu" === this.state.email && "abc123" === this.state.password)  
	{
	  this.setState({ authenticated: true });
	  console.log('Logged IN');
	}
	else 
	{
		this.setState({ authenticated: false });
	}
}

const Home = (props) => (


    <div>
        <nav>
			<ul>
				<li className = "Title">
					NOverdose
				</li>
				<li>
					<a onclick="{this.authenticateUser}">Logout </a>
				</li>
				<li>
					<a href = "">Search</a>
				</li>
				<li>
				  	<a href = "">Profile</a>
				</li>
				<li>
					<a onClick = {<Redirect to="/login"/>} >Home</a>
				</li>
		  	</ul>
        </nav>
		<h1>Profile Page</h1>
    </div>


);

export default Home;
